import React from "react";
import "./Timeline.css";
import { Row, Col } from "react-bootstrap";
import { Chrono } from "react-chrono";
import ByteDance from "../../Assets/ByteDance.png";

export default function Timeline() {
  const items = [
    {
      title: "Mar-July 2022",
      cardTitle: "ByteDance",
      url: "https://www.bytedance.com/en/",
      cardDetailedText:
        "Software Developer Intern. Built a microservice middleware with Golang, RESTful API, ElasticSearch, Clickhouse",
      media: {
        type: "IMAGE",
        source: {
          url: ByteDance,
        },
      },
    },
    {
      title: "May 1940",
      cardTitle: "Dunkirk",
      url: "http://www.history.com",
      cardSubtitle:
        "Men of the British Expeditionary Force (BEF) wade out to..",
      cardDetailedText:
        "Men of the British Expeditionary Force (BEF) wade out to..",
      media: {
        type: "IMAGE",
        source: {
          url: "http://someurl/image.jpg",
        },
      },
    },
  ];

  return (
    <div className="timeline">
      <Row>
        <Col md={1} />
        <Col>
          <h1 className="big-text">TIMELINE</h1>
          <hr></hr>
        </Col>
      </Row>
      <Row>
        <Col md={1}></Col>
        <Col>
          <div style={{ margin: "40px", height: "950px" }}>
            <Chrono items={items} mode="VERTICAL_ALTERNATING" scrollable/>
          </div>
        </Col>
      </Row>
    </div>
  );
}
